// AddCar.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function AddCar() {
    const [modelo, setModelo] = useState('');
    const [marca, setMarca] = useState('');
    const [ano, setAno] = useState('');
    const [categoria, setCategoria] = useState('');
    const [disponibilidade, setDisponibilidade] = useState(true);
    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();
        const newCar = { modelo, marca, ano, categoria, disponibilidade };

        fetch('http://localhost:25000/data', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(newCar),
        })
        .then(response => {
            if (response.ok) {
                navigate('/'); // Volta para a lista de carros
            } else {
                console.error("Erro ao adicionar carro:", response.statusText);
            }
        })
        .catch(error => console.error("Erro ao adicionar carro:", error));
    };

    return (
        <div>
            <h2>Adicionar Carro</h2>
            <form onSubmit={handleSubmit}>
                <label>
                    Modelo:
                    <input 
                        type="text" 
                        value={modelo} 
                        onChange={(e) => setModelo(e.target.value)} 
                        required 
                    />
                </label>
                <label>
                    Marca:
                    <input 
                        type="text" 
                        value={marca} 
                        onChange={(e) => setMarca(e.target.value)} 
                        required 
                    />
                </label>
                <label>
                    Ano:
                    <input 
                        type="number" 
                        value={ano} 
                        onChange={(e) => setAno(e.target.value)} 
                        required 
                    />
                </label>
                <label>
                    Categoria:
                    <input 
                        type="text" 
                        value={categoria} 
                        onChange={(e) => setCategoria(e.target.value)} 
                        required 
                    />
                </label>
                <label>
                    Disponibilidade:
                    <input 
                        type="checkbox" 
                        checked={disponibilidade} 
                        onChange={() => setDisponibilidade(!disponibilidade)} 
                    />
                </label>
                <button type="submit">Adicionar</button>
            </form>
        </div>
    );
}

export default AddCar;
